import NotificationList from './components/blocks/NotificationList';
// import Test from './components/blocks/Test';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}

        {/* < Test /> */}
        < NotificationForm />
        <Router>
            <Routes>
                <Route path="/" element={<NotificationList />} />
                <Route path="/new" element={<NotificationForm />} />
            </Routes>
        </Router>
      </header>
    </div>

  );
}

export default App;
